using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using Microsoft.AspNetCore.Http;
using Microsoft.AspNetCore.Mvc;
using Microsoft.EntityFrameworkCore;
using LibraryAPI.Models;
using LibraryAPI.ViewModels;

namespace LibraryAPI.Controllers
{
    [Route("api/[controller]")]
    [ApiController]
    public class BooksController : ControllerBase
    {
        private readonly BookContext _context;

        public BooksController(BookContext context)
        {
            _context = context;
            if (!_context.Books.Any())
            {
                var book1 = new Book
                {
                    Author = "Lewis Carroll",
                    Content = "1: Down the Rabbit Hole Chapter 2: The Pool of Tears Chapter 3: A Caucus Race Chapter 4: The Rabbit Sends in a Little Bill Chapter 5: Advice from a Caterpillar Chapter 6: Pig and Pepper Chapter 7: A Mad Tea-Party Chapter 8: The Queen's Croquet-Ground Chapter 9: Who Stole the Tarts?",
                    Genre = "Fantasy",
                    Cover = "",
                    Title = "Alice's Adventures in Wonderland"
                };
                var book2 = new Book
                {
                    Author = "J. K. Rowling",
                    Content = "Harry Potter book",
                    Genre = "Fantasy",
                    Cover = "",
                    Title = "Harry Potter and the Philosopher's Stone"
                };
                _context.Books.Add(book1);
                Rating rating1 = new Rating { Book = book1, Score = 3.0m };
                Rating rating2 = new Rating { Book = book1, Score = 4.0m };
                Rating rating3 = new Rating { Book = book2, Score = 4.0m };
                Rating rating4 = new Rating { Book = book2, Score = 5.0m };
                _context.Ratings.AddRange(rating1, rating2, rating3, rating4);
                Review review1 = new Review { Book = book1, Message = "I really like this book! It's my favourite.", Reviewer = "Tom Doe" };
                Review review2 = new Review { Book = book2, Message = "As a young reader, I found Alice in Wonderland creepy and rather distasteful. Alice's adventures played like a series of encounters with characters whose purpose was to tease, puzzle and torment her. Few children would want to go to wonderland, and none would want to stay. The problem may be that I encountered the book too young and was put off by the alarming John Tenniel illustrations. Why did Alice have such deep, dark eye sockets? Why couldn't Wonderland be cozy like the world of Pooh? Watching the 1951 Disney film, I feared the Cheshire Cat was about to tell me something I didn't want to know.", Reviewer = "Roger Ebert" };
                _context.Reviews.AddRange(review1, review2);
                _context.SaveChanges();
            }
        }

        // GET: api/books?order=author
        [HttpGet]
        public async Task<ActionResult<IEnumerable<BookViewModel>>> GetBooks(string order)
        {
            if (_context.Books == null)
            {
                return NotFound();
            }

            var books = _context.Books.
                Select(b => new BookViewModel()
                {
                    BookId = b.BookId,
                    Title = b.Title,
                    Author = b.Author,
                    Rating = (b.Ratings.FirstOrDefault() == null) ? 0m : b.Ratings.Average(x => x.Score),
                    ReviewsNumber = (b.Reviews.FirstOrDefault() == null) ? 0 : b.Reviews.Count
                });

            if (string.IsNullOrEmpty(order))
                return BadRequest();
            if (order.ToLower() == "author")
                return await books.OrderBy(x => x.Author).ToListAsync<BookViewModel>();
            else if (order.ToLower() == "title")
                return await books.OrderBy(x => x.Title).ToListAsync<BookViewModel>();
            else
                return BadRequest();
        }

        // TODO GET: api/Books/5
        [HttpGet("{id}")]
        public async Task<ActionResult<GetBookByIdViewModel>> GetAllBooksWithReviews(int id)
        {
            if (_context.Books == null)
            {
                return NotFound();
            }
            var book =  await _context.Books.FindAsync(id);
            //var book = await _context.Books.Include("Reviews").Include("Ratings").SingleOrDefaultAsync(x => x.BookId == id);

            if (book == null)
            {
                return NotFound();
            }
            var getBookByIdViewModel = new GetBookByIdViewModel()
            {
                BookId = book.BookId,
                Content = book.Content,
                Cover = book.Cover,
                Title = book.Title,
                Author = book.Author,
                Rating = (book.Ratings.FirstOrDefault() == null) ? 0m : book.Ratings.Average(x => x.Score),
                Reviews = (book.Reviews.FirstOrDefault() == null) ? new List<Review>() : book.Reviews
            };
            return new ObjectResult(getBookByIdViewModel);

        }

        // TODO PUT: api/Books/5
        // To protect from overposting attacks, see https://go.microsoft.com/fwlink/?linkid=2123754
        [HttpPut("{id}")]
        public async Task<IActionResult> PutBook(int id, Book book)
        {
            if (id != book.BookId)
            {
                return BadRequest();
            }

            _context.Entry(book).State = EntityState.Modified;

            try
            {
                await _context.SaveChangesAsync();
            }
            catch (DbUpdateConcurrencyException)
            {
                if (!BookExists(id))
                {
                    return NotFound();
                }
                else
                {
                    throw;
                }
            }

            return NoContent();
        }

        // TODO POST: api/Books
        // To protect from overposting attacks, see https://go.microsoft.com/fwlink/?linkid=2123754
        [HttpPost]
        public async Task<ActionResult<Book>> PostBook(Book book)
        {
            if (_context.Books == null)
            {
                return Problem("Entity set 'BookContext.Books'  is null.");
            }
            _context.Books.Add(book);
            await _context.SaveChangesAsync();

            return CreatedAtAction(nameof(GetBooks), new { id = book.BookId }, book);
        }

        // TODO DELETE: api/Books/5
        [HttpDelete("{id}")]
        public async Task<IActionResult> DeleteBook(int id)
        {
            if (_context.Books == null)
            {
                return NotFound();
            }
            var book = await _context.Books.FindAsync(id);
            if (book == null)
            {
                return NotFound();
            }

            _context.Books.Remove(book);
            await _context.SaveChangesAsync();

            return NoContent();
        }

        private bool BookExists(int id)
        {
            return (_context.Books?.Any(e => e.BookId == id)).GetValueOrDefault();
        }
    }
}
